import React, { Fragment } from "react";
import "./App.css";

// Components
import CreateEvent from "./components/createEvent";
import ListEvent from "./components/listEvent";

function App() {
  return (
    <Fragment>
      <div className="container">
        <CreateEvent />
        <ListEvent />
      </div>
    </Fragment>
  );
}

export default App;
